import React from 'react';

type TodolistType = {
   task: Array<TaskType>
}

type TaskType = {
    id:string;
    title:string;
    isDone:boolean;
}

export  const Todolist = (props:TodolistType) => {
    return (
        <div>
                 {props.task.map((el)=>{
                     return (
                         <div key={el.id}>
                             <li>{el.title}</li>
                             <input type={'checkbox'}/>
                         </div>

                     )
                 })
                 }


        </div>
    );
};
